begin
execute immediate 'grant select,update,delete,insert on ' || '<?=odiRef.getSchemaName("VIN_ORACLE", "W") ?>.F$_PARTY_LOCATOR' || ' to DEV_EDW_ODI';
end;

declare
  l_index_name varchar2(50 char);
  l_index_schema_name varchar2(50 char);
  l_found boolean := false;
begin
  for r in (
            select index_name,table_owner from all_indexes
                    where 1=1
                    and table_owner = '<?=odiRef.getSchemaName() ?>' 
                    and table_name = 'PARTY_LOCATOR' 
  ) loop 
    l_found := true;
    l_index_name := r.index_name;
    l_index_schema_name := r.table_owner;
    execute immediate 'alter index '|| l_index_schema_name ||'.'|| l_index_name || ' visible';
    execute immediate 'alter index '|| l_index_schema_name ||'.'|| l_index_name || ' rebuild';
    end loop;
  if (l_found = false) then
    raise_application_error(-20001, 'YANLIS INDEX GIRILDI!');
  end if;
end;

begin
    dbms_stats.gather_table_stats(
	ownname => '<?= odiRef.getInfo("DEST_WORK_SCHEMA") ?>',
